import React from 'react';

export default function Feature() {
  return (
    <div className='container' style={{ borderTop: '2px solid black', marginTop: '150px', width: '100%' }}>
        <div className="row" style={{background: '#fff6d7'}}>
            <div className="col-sm-8 d-flex align-items-center justify-content-center">
                <div className="text-center">first</div>
            </div>
            <div className="col-sm-4 p-0 mt-4">
                <div className="row">
                <img 
                    src="https://yellow.ai/wp-content/uploads/2024/06/healthcare-inline-img-2-1-1010x1024.webp" 
                    alt="" 
                    style={{ width: 'auto', height: 'auto', display: 'block' , marginTop: '50px'}} 
                />
                </div>
            </div>
        </div>
    </div>
  );
}
